function Form(props) {
    return (
        <form>
            {Object.keys(props.object).map((key) => {
                return (
                    <div>
                        <label>{key}</label>
                        <input
                            type="text"
                            value={props.object[key]}
                            onChange={(e) => {
                                props.object[key] = e.target.value;
                            }}
                        />
                    </div>
                );
            })}
        </form>
    );
}

export default Form;
